import "./App.css";
import Footer from "./components/Footer";
import Header from "./components/Header";
import SideBar from "./components/SideBar";

function App() {
  return (
    <div>
      <div className="A">
        <div className="A-1">
          <SideBar />
        </div>
        <div className="A-2">
         <Header />
         <hr id="hr3" />
        </div> 
      </div>
      <hr id="hr" />
      <Footer />
    </div>
  );
}

export default App;
